"""
数字 n 代表生成括号的对数，请你设计一个函数，用于能够生成所有可能的并且 有效的 括号组合。
https://leetcode-cn.com/problems/generate-parentheses/
"""
from typing import List


class Solution:
    @staticmethod
    def generateParenthesis(n: int) -> List[str]:
        ans = []

        def dfs(cur_str: str, l_cnt: int, r_cnt: int):
            # restrictions
            # a >= b
            # a <= n
            # b <= n

            if l_cnt == r_cnt == n:
                ans.append(cur_str)
                return

            # add left
            if l_cnt < n:
                dfs(cur_str + '(', l_cnt=l_cnt + 1, r_cnt=r_cnt)

            # add right
            if r_cnt < n and l_cnt > r_cnt:
                dfs(cur_str + ')', l_cnt=l_cnt, r_cnt=r_cnt + 1)

        dfs('(', l_cnt=1, r_cnt=0)
        return ans

